import { createTheme } from "@mui/material";

const theme = createTheme({
  palette: {
    primary: {
      main: "#FFFFFF",
      contrastText: "#03030B",
    },
    text: {},
    secondary: {
      light: "#E8F9F3",
      main: "rgb(63, 173, 133)",
      contrastText: "#FFFFFF",
    },
  },
});
export default theme;
